import React from 'react'
import { Table } from 'react-bootstrap';

const MainTable = ({ tbody, thead }) => {

    var table = {}
    table.thead = thead.thead;
    table.tbody = tbody.tbody;
    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    {table.thead?.map( (ele, index)=> {
                        return (<th>{ele}</th>)
                    }).join("")}
                </tr>
            </thead>
            <tbody>
                <tr>
                    {table.tbody ? ( table.tbody?.map( (row, index)=> {
                        row?.map((val, i) => {
                            return (<td>{val}</td>)
                        }).join("</tr><tr>")
                    }).join("")) : <td colSpan={table.thead.length}>No Information Available</td> }
                </tr>
            </tbody>
      </Table>
    )
}

export default MainTable
